import React, {FC} from 'react';

import cl from './MyModal.module.css';
import { modalPropetiesType, modalTypes } from '../../../types/modalType';
import MyForm from '../MyForm/MyForm';

interface MyModalProps {
    method: modalTypes,
    modalPropeties: modalPropetiesType
}

const MyModal: FC<MyModalProps> = ({
    method,
    modalPropeties

}) => {

    const rootClasses = [cl.myModal];

    if (modalPropeties.visible) {
        rootClasses.push(cl.active);
    }

  return (
    <div className={rootClasses.join(' ')} onClick={() => modalPropeties.setVisible(false)}>
        <div className={cl.myModalContent} onClick={(e) => e.stopPropagation()}>
            <MyForm method={method} setVisible={modalPropeties.setVisible}/>
        </div>
    </div>

  );
}


export default MyModal;
